#pragma arguments
texture2d image;
texture2d shapeSDF;
texture1d colorLUT;
texture1d colorLUTBottom;
float3 attractor1;
float3 attractor2;
float3 attractor3;
float3 attractor4;
float3 attractor5;
float3 attractor6;
float2 position;
float intertiaRotation;
float scale;
float blobZoom;
float opacity;
float transitionToRectangleProcessing;
float4 transitions_blob_picture_finalPicture_rectangle;
float transitionToError;
float transitionToShape;
float showImage;
float imageRatio;
float lightMode; //no bool or int in custom properties
float genmojiMode; //no bool or int in custom properties
float genmojiRampSize;
float2 rectangleSize;
float rectangleRadius;
float imageScale;
float3 latency;
float blobAnimationSpeed;
float2 progress_intensity;
float2 image_size;
//float HDRMode;

